"obd_clear_info" : "Цяпер будзе скінуты MIL і ачышчаныя ўсе дыягнастычныя даныя, 
датычныя выкідаў, уключаючы: 
 - дыягнастычныя коды праблем; 
 - фрыз-кадры; 
 - даныя кіслародных датчыкаў; 
 - стан тэстаў сістэмнага маніторынга; 
 - стан тэстаў бартавога маніторынга; 
 - пройдзены шлях пасля актывацыі MIL; 
 - колькасць прагрэваў пасля ачысткі DTC; 
 - пройдзены шлях пасля чысткі DTC; 
 - час працы рухавіка пасля актывацыі MIL; 
 - час з моманту чысткі DTC. 

Могуць адбыцца іншыя дзеянні па ачысцы ў залежнасці ад вытворца. 
Страта гэтых даных можа прывесці да кароткачасовай 
нездавальняючай працы рухавіка, пакуль ECU не адкалібруецца."
